{
    "$schema": "http://json-schema.org/draft-07/schema#",
    "title": "GenAI Conversation Log",
    "description": "Schema for a conversation log with a Generative AI tool, capturing history, tool usage, and context.",
    "type": "object",
    "required": [
      "conversation_id",
      "history",
      "transcript"
    ],
    "properties": {
      "conversation_id": {
        "type": "string",
        "format": "uuid",
        "description": "Unique identifier for the entire conversation."
      },
      "next_message": {
        "type": [
          "string",
          "null"
        ],
        "description": "Identifier for the next message in a sequence, if applicable."
      },
      "history": {
        "type": "array",
        "description": "An array of conversation turns, where each turn is an array of messages.",
        "items": {
          "type": "array",
          "items": {
            "$ref": "#/$defs/message"
          }
        }
      },
      "valid_history_range": {
        "type": "array",
        "description": "A tuple indicating the valid start and end indices of the history.",
        "items": [
          {
            "type": "integer"
          },
          {
            "type": "integer"
          }
        ],
        "minItems": 2,
        "maxItems": 2
      },
      "transcript": {
        "type": "array",
        "description": "A flat-text transcript of the conversation.",
        "items": {
          "type": "string"
        }
      },
      "tools": {
        "type": "object",
        "description": "A collection of available tools, categorized by their namespace.",
        "patternProperties": {
          "^[a-zA-Z0-9_]+$": {
            "type": "array",
            "items": {
              "$ref": "#/$defs/toolSpecification"
            }
          }
        }
      },
      "context_manager": {
        "type": "object",
        "properties": {
          "max_context_files_size": { "type": "integer" },
          "global_config": { "$ref": "#/$defs/contextConfig" },
          "current_profile": { "type": "string" },
          "profile_config": { "$ref": "#/$defs/contextConfig" }
        }
      },
      "context_message_length": { "type": "integer" },
      "latest_summary": { "type": ["string", "null"] },
      "model": { "type": "string" }
    },
    "$defs": {
      "message": {
        "type": "object",
        "description": "A single message in a conversation turn. The structure can vary.",
        "oneOf": [
          { "$ref": "#/$defs/userSystemMessage" },
          { "$ref": "#/$defs/toolUseMessage" },
          { "$ref": "#/$defs/responseMessage" }
        ]
      },
      "userSystemMessage": {
          "type": "object",
          "required": ["content"],
          "properties": {
              "additional_context": { "type": "string" },
              "env_context": { "$ref": "#/$defs/envContext" },
              "content": {
                  "oneOf": [
                      { "$ref": "#/$defs/promptContent" },
                      { "$ref": "#/$defs/toolUseResultsContent" }
                  ]
              },
              "images": { "type": ["array", "null"], "items": { "type": "string" } }
          }
      },
      "toolUseMessage": {
          "type": "object",
          "required": ["ToolUse"],
          "properties": {
              "ToolUse": { "$ref": "#/$defs/toolUse" }
          }
      },
      "responseMessage": {
          "type": "object",
          "required": ["Response"],
          "properties": {
              "Response": {
                  "type": "object",
                  "properties": {
                      "message_id": { "type": "string", "format": "uuid" },
                      "content": { "type": "string" }
                  }
              }
          }
      },
      "envContext": {
        "type": "object",
        "properties": {
          "env_state": {
            "type": "object",
            "properties": {
              "operating_system": { "type": "string" },
              "current_working_directory": { "type": "string" },
              "environment_variables": { "type": "array", "items": { "type": "string" } }
            }
          }
        }
      },
      "promptContent": {
        "type": "object",
        "properties": {
          "Prompt": {
            "type": "object",
            "properties": { "prompt": { "type": "string" } }
          }
        }
      },
      "toolUseResultsContent": {
        "type": "object",
        "properties": {
          "ToolUseResults": {
            "type": "object",
            "properties": {
              "tool_use_results": {
                "type": "array",
                "items": { "$ref": "#/$defs/toolUseResult" }
              }
            }
          }
        }
      },
      "toolUseResult": {
        "type": "object",
        "properties": {
          "tool_use_id": { "type": "string" },
          "content": {
            "type": "array",
            "items": {
              "type": "object",
              "oneOf": [
                { "properties": { "Json": { "type": "object" } } },
                { "properties": { "Text": { "type": "string" } } }
              ]
            }
          },
          "status": { "type": "string", "enum": ["Success", "Error"] }
        }
      },
      "toolUse": {
        "type": "object",
        "properties": {
          "message_id": { "type": "string", "format": "uuid" },
          "content": { "type": "string" },
          "tool_uses": {
            "type": "array",
            "items": {
              "type": "object",
              "properties": {
                "id": { "type": "string" },
                "name": { "type": "string" },
                "orig_name": { "type": "string" },
                "args": { "type": "object" },
                "orig_args": { "type": "object" }
              }
            }
          }
        }
      },
      "toolSpecification": {
        "type": "object",
        "properties": {
          "name": { "type": "string" },
          "description": { "type": "string" },
          "input_schema": {
            "type": "object",
            "properties": {
              "json": {
                "type": "object",
                "description": "A valid JSON Schema object describing the tool's input.",
                "properties": {
                  "$schema": { "type": "string", "format": "uri" },
                  "type": { "type": "string" },
                  "properties": { "type": "object" },
                  "required": { "type": "array", "items": { "type": "string" } }
                },
                "additionalProperties": true
              }
            }
          }
        }
      },
      "contextConfig": {
          "type": "object",
          "properties": {
              "paths": { "type": "array", "items": { "type": "string" } },
              "hooks": { "type": "object" }
          }
      }
    }
  }

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { HomePage } from './pages/HomePage';
import { DemoPage } from './pages/DemoPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/demo" element={<DemoPage />} />
      </Routes>
    </Router>
  );
}

export default App;

import { useState, useCallback } from 'react';
import { Link } from 'react-router-dom';
import { ConversationData } from '../types';
import { FileUpload } from '../components/FileUpload';
import { ConversationViewer } from '../components/ConversationViewer';
import { Header } from '../components/Header';

export function HomePage() {
  const [conversationData, setConversationData] = useState<ConversationData | null>(null);
  const [error, setError] = useState<string | null>(null);

  const handleFileUpload = useCallback((data: ConversationData) => {
    setConversationData(data);
    setError(null);
  }, []);

  const handleError = useCallback((errorMessage: string) => {
    setError(errorMessage);
    setConversationData(null);
  }, []);

  const handleReset = useCallback(() => {
    setConversationData(null);
    setError(null);
  }, []);

  return (
    <div className="min-h-screen bg-gray-50">
      <Header onReset={conversationData ? handleReset : undefined} />

      <main className="container mx-auto px-4 py-8">
        {error && (
          <div className="mb-6 p-4 bg-error-50 border border-error-200 rounded-lg">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <svg className="h-5 w-5 text-error-400" viewBox="0 0 20 20" fill="currentColor">
                  <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z" clipRule="evenodd" />
                </svg>
              </div>
              <div className="ml-3">
                <h3 className="text-sm font-medium text-error-800">Error</h3>
                <div className="mt-2 text-sm text-error-700">
                  <p>{error}</p>
                </div>
              </div>
            </div>
          </div>
        )}

        {!conversationData ? (
          <>
            <FileUpload onFileUpload={handleFileUpload} onError={handleError} />

            {/* Demo page link */}
            <div className="max-w-2xl mx-auto mt-8">
              <div className="bg-blue-50 border border-blue-200 rounded-lg p-6 text-center">
                <div className="flex items-center justify-center mb-3">
                  <svg 
                    className="w-6 h-6 text-blue-600 mr-2" 
                    fill="none" 
                    stroke="currentColor" 
                    viewBox="0 0 24 24"
                    aria-hidden="true"
                  >
                    <path 
                      strokeLinecap="round" 
                      strokeLinejoin="round" 
                      strokeWidth={2} 
                      d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" 
                    />
                    <path 
                      strokeLinecap="round" 
                      strokeLinejoin="round" 
                      strokeWidth={2} 
                      d="M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z" 
                    />
                  </svg>
                  <h3 className="text-lg font-medium text-blue-900">
                    Try the Demo
                  </h3>
                </div>
                <p className="text-blue-700 mb-4">
                  Want to see how it works first? Check out our demo with sample conversation data.
                </p>
                <Link
                  to="/demo"
                  className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-md shadow-sm text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 transition-colors"
                  aria-label="View demo with sample conversation data"
                >
                  <svg 
                    className="w-4 h-4 mr-2" 
                    fill="none" 
                    stroke="currentColor" 
                    viewBox="0 0 24 24"
                    aria-hidden="true"
                  >
                    <path 
                      strokeLinecap="round" 
                      strokeLinejoin="round" 
                      strokeWidth={2} 
                      d="M14.828 14.828a4 4 0 01-5.656 0M9 10h1m4 0h1m-6 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" 
                    />
                  </svg>
                  View Demo
                </Link>
              </div>
            </div>
          </>
        ) : (
          <ConversationViewer data={conversationData} />
        )}
      </main>
    </div>
  );
}

import React from 'react';

interface HeaderProps {
  onReset?: () => void;
  isDemoMode?: boolean;
}

export function Header({ onReset, isDemoMode = false }: HeaderProps) {
  return (
    <header className="bg-white shadow-sm border-b border-gray-200">
      <div className="container mx-auto px-4 py-4">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-3">
            <div className="w-8 h-8 bg-primary-500 rounded-lg flex items-center justify-center">
              <svg className="w-5 h-5 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 12h.01M12 12h.01M16 12h.01M21 12c0 4.418-4.03 8-9 8a9.863 9.863 0 01-4.255-.949L3 20l1.395-3.72C3.512 15.042 3 13.574 3 12c0-4.418 4.03-8 9-8s9 3.582 9 8z" />
              </svg>
            </div>
            <div>
              <div className="flex items-center space-x-2">
                <h1 className="text-xl font-semibold text-gray-900">GenAI Conversation Viewer</h1>
                {isDemoMode && (
                  <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-blue-100 text-blue-800 border border-blue-200">
                    <svg className="w-3 h-3 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 16h-1v-4h-1m1-4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
                    </svg>
                    Demo Mode
                  </span>
                )}
              </div>
              <p className="text-sm text-gray-500">
                {isDemoMode 
                  ? "Exploring with example conversation data" 
                  : "Visualize conversation history from GenAI tools"
                }
              </p>
            </div>
          </div>

          {onReset && (
            <button
              onClick={onReset}
              className="inline-flex items-center px-4 py-2 border border-gray-300 rounded-md shadow-sm text-sm font-medium text-gray-700 bg-white hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 transition-colors"
            >
              <svg className="w-4 h-4 mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6v6m0 0v6m0-6h6m-6 0H6" />
              </svg>
              Load New File
            </button>
          )}
        </div>
      </div>
    </header>
  );
}

