}

.custom-scrollbar::-webkit-scrollbar-track {
  background: #fff7ed;
  border-radius: 4px;
}

.custom-scrollbar::-webkit-scrollbar-thumb {
  background: linear-gradient(to bottom, #fdba74, #fb923c);
  border-radius: 4px;
}

.custom-scrollbar::-webkit-scrollbar-thumb:hover {
  background: linear-gradient(to bottom, #fb923c, #f97316);
}

/* Q CLI specific styling */
.q-cli-badge {
  background: linear-gradient(135deg, #f97316, #ea580c);
  color: white;
  font-weight: 600;
  text-shadow: 0 1px 2px rgba(0, 0, 0, 0.1);
}

.q-cli-card {
  background: white;
  border: 1px solid #fed7aa;
  box-shadow: 0 4px 6px -1px rgba(249, 115, 22, 0.1), 0 2px 4px -1px rgba(249, 115, 22, 0.06);
}

.q-cli-card:hover {
  box-shadow: 0 10px 15px -3px rgba(249, 115, 22, 0.1), 0 4px 6px -2px rgba(249, 115, 22, 0.05);
  transform: translateY(-1px);
  transition: all 0.2s ease-in-out;
}

/* Message type indicators */
.message-user {
  border-left: 4px solid #3b82f6;
  background: linear-gradient(to right, #eff6ff, #ffffff);
}

.message-tool-use {
  border-left: 4px solid #a855f7;
  background: linear-gradient(to right, #faf5ff, #ffffff);
}

.message-tool-result {
  border-left: 4px solid #6b7280;
  background: linear-gradient(to right, #f9fafb, #ffffff);
}

.message-response {
  border-left: 4px solid #22c55e;
  background: linear-gradient(to right, #f0fdf4, #ffffff);
}

/* Gradient backgrounds */
.gradient-orange {
  background: linear-gradient(135deg, #f97316, #ea580c);
}

.gradient-blue {
  background: linear-gradient(135deg, #3b82f6, #2563eb);
}

.gradient-purple {
  background: linear-gradient(135deg, #a855f7, #9333ea);
}

/* Animation for loading states */
@keyframes pulse-orange {
  0%, 100% {
    opacity: 1;
  }
  50% {
    opacity: 0.5;
  }
}

.animate-pulse-orange {
  animation: pulse-orange 2s cubic-bezier(0.4, 0, 0.6, 1) infinite;
}

/* Tool usage visualization */
.tool-usage-bar {
  background: linear-gradient(to right, #fed7aa, #f97316);
  border-radius: 4px;
  height: 8px;
  transition: all 0.3s ease;
}

.tool-usage-bar:hover {
  height: 12px;
  background: linear-gradient(to right, #fb923c, #ea580c);
}

